import React from "react";
import App2 from "./app2";
import { My_Context } from "./App";

export default function app1() {
  const { value } = React.useContext(My_Context);
  return (
    <div>
      <p>App 1</p>
      <p>This should render the count {value}</p>
      <App2 />
    </div>
  );
}
